//日志组件
import LogItem from "./LogItem";
import "./Logs.css";
import data from "../../data";
const Logs = () => {
  const logItemData = data.map((item) => <LogItem data={item} key={item.id} />);
  return (
    <div className="logs">
      {data.map((item) => (
        <LogItem data={item} key={item.id} />
      ))}
    </div>
  );
};
export default Logs;
